-- ----------------------------
-- Table structure for t_movie
-- ----------------------------
DROP TABLE IF EXISTS `t_movie`;
CREATE TABLE `t_movie` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(45) NOT NULL,
  `director` varchar(45) NOT NULL COMMENT '导演',
  `actors` varchar(90) NOT NULL COMMENT '主演',
  `story` varchar(600) NOT NULL COMMENT '简介',
  `type` varchar(45) NOT NULL COMMENT '类型',
  `img` longtext,
  `time` date NOT NULL COMMENT '上映日期',
  `rating` float(10,6) unsigned DEFAULT '3.500000' COMMENT '评分',
  `stars` int(11) DEFAULT '0',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=69 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='电影信息表';

