INSERT INTO `t_movie` VALUES ('64', '八佰', '管虎', '黄志忠 欧豪 王千源 姜武 张译 杜淳 魏晨 李晨 俞灏明', '1937年淞沪会战末期，中日双方激战已持续三个月，上海濒临沦陷。第88师262旅524团团副谢晋元（杜淳饰）率420余人，孤军坚守最后的防线，留守上海四行仓库 。与租界一河之隔，造就了罕见的被围观的战争。为壮声势，实际人数四百人而对外号称八百人  。“八百壮士”奉命留守上海闸北，在苏州河畔的四行仓库鏖战四天，直至10月30日才获令撤往英租界  。', '剧情/喜剧', 'data:image/jpeg;base64,', '2020-08-21', '5.000000', '131');
INSERT INTO `t_movie` VALUES ('65', '姜子牙', '程腾', '', '封神大战之后。昆仑弟子姜子牙，率领众神战胜狐妖，推翻了残暴的商王朝，赢得封神大战的胜利，即将受封为众神之长。在巅峰时刻，他却因一时之过被贬下凡间。失去神力，被世人唾弃。为重回昆仑，姜子牙踏上旅途。在战后的废墟之上，他重新找到了自我，也发现了当年一切的真相', '奇幻', 'data:image/jpeg;base64,', '2020-10-01', '5.000000', '9401');
INSERT INTO `t_movie` VALUES ('66', '一点就到家', '许宏宇', '刘昊然 彭昱畅 尹昉', '魏晋北（刘昊然 饰）、彭秀兵（彭昱畅 饰）、李绍群（尹昉 饰）三个性格迥异的年轻人从大城市回到云南千年古寨，机缘巧合下合伙干电商。三个年轻人在走弯路后，一拍即合携手开启创业之旅，他们明白了电商下乡，不仅仅是把城里面的东西卖到农村来，也是要把农村的东西卖出去   。与古寨“格格不入”的他们用真诚改变了所有人，开启了一段纯真且荒诞的创业旅程', '剧情/喜剧', 'data:image/jpeg;base64,', '2020-10-04', '5.000000', '736900');
INSERT INTO `t_movie` VALUES ('67', '夺冠', '陈可辛', '巩俐 黄渤 吴刚 彭昱畅 白浪 中国女子排球队', '1980年训练赛，中国女排对战中国男排冠军江苏队，女排负。但那一代女排训练之艰苦，之刻苦，之永不言弃，已跃然银幕。1981年大阪世界杯决赛，中国队对战日本队，赢得了中国三大球第一个世界冠军，宋世雄那铿锵有力、极具辨识度的解说，一下子将观众带回了那个激情澎湃、阳光普照的年代。2008年北京奥运会小组赛，中国队对战当时主教练是郎平（巩俐饰）的美国队，中国队教练（黄渤饰）站在场边，全神贯注，面带笑容。郎平和那一代中国女排在那一刻所经历过的挣扎，令人心疼。2013年，郎平正式再次挂帅执教中国女排，带领着中国女排开启了新的历史阶段。2016年里约奥运会四分之一淘汰赛，中国队对战东道主世界排名第一的巴西队，最终获得了奥运会的金牌', '纪录片', 'data:image/jpeg;base64,', '2020-09-05', '5.000000', '783');
INSERT INTO `t_movie` VALUES ('68', '急先锋', '唐季礼', '成龙 杨洋 艾伦 徐若晗 母其弥雅 朱正廷', '中国商人秦国立在英国惨遭雇佣兵组织“北极狼”绑架，秦的女儿Fareeda（徐若晗饰）也卷入其中，遭到追杀。千钧一发之际，急先锋国际安保团队成为他们仅有的希望，由总指挥唐焕庭（成龙饰）带领雷震宇（杨洋饰）、张凯旋（艾伦饰）、弥雅（母其弥雅饰）、神雕（朱正廷饰）等组成的急先锋行动小组，上天入地，辗转全球各地施展惊险营救。而在解救人质的过程中，还发现了“北极狼”背后的犯罪集团策划的一场惊天密谋', '动作片', 'data:image/jpeg;base64,', '2020-09-30', '5.000000', '2');
